import React, { Component } from 'react';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';

function calculate () {console.log('weight calculated')}

class ReverseMax extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 

        var inputStyle = {
            position: 'sticky',
            width: '50%',
            textAlign: 'center',
            justifyContent: 'center',
            height: '10rem',
            marginBottom: '10rem', 
            marginTop: '5rem'
            
        }

        return (
            <div style={inputStyle}>

            <form noValidate autoComplete="off">
            <TextField type="number" id="OneRM" label="Enter One Rep Max" variant="outlined" margin="dense" required="True" size="large"/>
            </form>

            <p>THEN</p>
    
            <form noValidate autoComplete="off">
            <TextField type="number" id="Reps" label="Enter goal reps" variant="outlined" 
            margin="dense" required="True" size="medium"/>
            </form>

            <p>OR</p>

            <form noValidate autoComplete="off">
            <TextField type="number" id="Weight" label="Enter goal weight" variant="outlined" 
            margin="dense" required="True" size="medium"/>
            </form>
    
    
            <Button variant="contained" color="primary" onClick={calculate}>
            Calculate
            </Button>

            </div>
        );
    }
}
 
export default ReverseMax;
